"use strict";(self.webpackChunkbublik_release=self.webpackChunkbublik_release||[]).push([[414],{8404:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"release-v0.1.5","metadata":{"permalink":"/bublik-release/release-v0.1.5","editUrl":"https://github.com/oktetlabs/bublik-release/edit/main/blog/2023-05-31-release-v0.1.5/index.mdx","source":"@site/blog/2023-05-31-release-v0.1.5/index.mdx","title":"Release v0.1.5","description":"We are happy to announce Bublik v0.1.5","date":"2023-05-31T00:00:00.000Z","formattedDate":"May 31, 2023","tags":[{"label":"release","permalink":"/bublik-release/tags/release"}],"readingTime":3.97,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/ol-limonikas","imageURL":"https://github.com/ol-limonikas.png","key":"ol-limonikas"}],"frontMatter":{"title":"Release v0.1.5","authors":["ol-limonikas"],"tags":["release"],"slug":"release-v0.1.5"},"nextItem":{"title":"Release v0.1.3","permalink":"/bublik-release/release-v0.1.3"}},"content":"We are happy to announce **Bublik v0.1.5**\\nIn this release we added initial support for new log UI. Added ability to open/collapse sidebar menus.\\nMany more style and internal changes\\n\\n\x3c!--truncate--\x3e\\n\\n# Highlights\\n\\n### Reworked sidebar\\n\\nWe\'ve added ability to show/hide collapsed menus inside sidebar at any time. Now you can jump back and forth between different pages\\n\\n:::tip\\nAlso you can now hide/show sidebar by pressing **`S`** on the keyboard\\n:::\\n\\n![Reworked sidebar](./img/Capture-2023-06-09-103917.png)\\n\\n### New changelog UI\\n\\nWe also added changelog\\n\\n![New changelog](./img/Capture-2023-06-09-104647.png)\\n\\n### Reworked run toolbar\\n\\nWe\'ve moved toolbar with various buttons\\n\\n![Reworked toolbar](./img/Capture-2023-06-09-104900.png)\\n\\nAdded ability to hide/show columns via dropdown menu\\n\\n![Toggle run table columns](./img/Capture-2023-06-09-105115.png)\\n\\n### Opening NOK results on link click\\n\\nYou can now go to run with opened results by clicking on NOK with `Ctrl+click`\\n\\n![Nok results](./img/Capture-2023-06-09-105620.png)\\n\\n### New log UI\\n\\n:::caution\\nThis is experimental feature and may not work as expected!\\n:::\\n\\nIn this release we started to integrate new log UI this is still work in progress.\\nWe want to hear your feedback and features you maybe want :)\\n\\n![New log UI](./img/Capture-2023-06-09-110507.png)\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\udcdd Documentation\\n\\n- **config:** adjust docs to new build pipeline ([216af6a](https://github.com/oktetlabs/bublik-ui/commit/216af6a534f13152f33d3c18c5dc08eb5d9ae118))\\n\\n#### \ud83d\udc77\u200d Build System\\n\\n- **size:** extract echarts chunk manulally to reduce size ([ba312fe](https://github.com/oktetlabs/bublik-ui/commit/ba312feb27f30d13c9120428c8bd1e8863d9fffd))\\n- **vite:** add ability to specify remote JSON logs storage ([6f915d4](https://github.com/oktetlabs/bublik-ui/commit/6f915d456fd6272db145b8ad0f502d8583d08ab1))\\n\\n#### \ud83d\udd27 Continuous Integration | CI\\n\\n- **build:** fix failing to parse passed args ([af3151e](https://github.com/oktetlabs/bublik-ui/commit/af3151ed8c9027664fd41efd4b3617593d41979c))\\n- **build:** skip changelog for beta releases ([72801ed](https://github.com/oktetlabs/bublik-ui/commit/72801ed5183c806fa3ab9ba240e39807dc2f7104))\\n\\n#### \u267b Code Refactoring\\n\\n- **icon:** convert all icons to `.svg` ([#439](https://github.com/oktetlabs/bublik-ui/issues/439)) ([d056f89](https://github.com/oktetlabs/bublik-ui/commit/d056f89088ade06ca077a5ffa6d5dd93deaf83d8))\\n- **run:** change displayed run columns ([1896f7e](https://github.com/oktetlabs/bublik-ui/commit/1896f7e3e86e25a80ea56d99114668e974d5cab7))\\n- **ui:** replace all skeletons with component ([96b32ba](https://github.com/oktetlabs/bublik-ui/commit/96b32ba67c27819b61369e873c0d5d444c855da3))\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- **history:** lazy loading modules ([5f9e6ed](https://github.com/oktetlabs/bublik-ui/commit/5f9e6ed05536bcdd191b82b7a05e2969680bbb7e))\\n- **log:** [frame] not saving line number on subsequent navigations ([4e185aa](https://github.com/oktetlabs/bublik-ui/commit/4e185aa212943fb92559006608dbb48c84022ccc))\\n- **runs:** date range picker no label warning ([4b9f05f](https://github.com/oktetlabs/bublik-ui/commit/4b9f05ff6290a05c4a37971bb4ec8fe58dbc4896))\\n- **runs:** importing from lazy loaded module ([4c8fe1a](https://github.com/oktetlabs/bublik-ui/commit/4c8fe1a0b6ac5ba9c138eee8f758091dacc74f1a))\\n\\n#### \ud83d\udc85 Polish\\n\\n- **animation:** [dialog] add animation to dialog content ([cf17bf6](https://github.com/oktetlabs/bublik-ui/commit/cf17bf6e39219140708ffed005520132a69bde9e))\\n- **changelog:** add confetti explosion on new release ([645202e](https://github.com/oktetlabs/bublik-ui/commit/645202e49be6d06918751fd7719df7347f449e12))\\n- **history:** add animation to context menu ([3c7242e](https://github.com/oktetlabs/bublik-ui/commit/3c7242e14c8ff993dfe33dcd91b9e791ea44bd5b))\\n- **history:** align reset buttons with close button ([4957228](https://github.com/oktetlabs/bublik-ui/commit/49572288a532c92263c784ee043d4cbcaf64474f))\\n- **import:** fix overflow scrollbars ([16ffa15](https://github.com/oktetlabs/bublik-ui/commit/16ffa154207cab47b7a19e1b09bdbea6af1ba52e))\\n- **import:** make modal title bigger ([bb84145](https://github.com/oktetlabs/bublik-ui/commit/bb841456abc5f2aebbfb5775c1358c782198ac4f))\\n- **run:** [table] add group columns with border ([af37d1e](https://github.com/oktetlabs/bublik-ui/commit/af37d1e588a833642892869a86efa27370c7e108))\\n- **run:** add background on row hover ([ed74c97](https://github.com/oktetlabs/bublik-ui/commit/ed74c97cfbd90d229327d4b294b6250d4507b607))\\n- **run:** uppercase table columns ([abcf61b](https://github.com/oktetlabs/bublik-ui/commit/abcf61b78585f6a68301ecb7ce625d07fdf93f30))\\n- **tooltip:** change shadow ([46e3238](https://github.com/oktetlabs/bublik-ui/commit/46e3238d7c3df2869fac9ae230e1d51d5a7eae95))\\n\\n#### \ud83d\ude80 New Feature\\n\\n- **ci:** add changelog to the ui ([#434](https://github.com/oktetlabs/bublik-ui/issues/434)) ([a7109ff](https://github.com/oktetlabs/bublik-ui/commit/a7109ffd13e81a28b9966c9625fd8e75cdd8d1be))\\n- **faq:** add latest tag info ([cbe7b4e](https://github.com/oktetlabs/bublik-ui/commit/cbe7b4e6b98845906c38030648f4b1a570f0d3b9))\\n- **formatting:** convert formatting to use tabs ([4b348d1](https://github.com/oktetlabs/bublik-ui/commit/4b348d10816cccec47a1091bf6a0a4a48800a9ec))\\n- **log:** add experimental support for JSON logs ([677fd29](https://github.com/oktetlabs/bublik-ui/commit/677fd29c11a550e7d59d9d4ff3b8b81ed0f3dae7))\\n- **log:** add initial support for displaying log content ([d8ebcb1](https://github.com/oktetlabs/bublik-ui/commit/d8ebcb180a2b3d2dd86448f63ac3668a28488be8))\\n- **log:** add pagination support to schema ([6a1af72](https://github.com/oktetlabs/bublik-ui/commit/6a1af728788b0828326215dc30de9f096b78a9be))\\n- **log:** add pagination support to schema ([36706ae](https://github.com/oktetlabs/bublik-ui/commit/36706ae21021f73e96c327287bcc64795ad69403))\\n- **run:** [results-table] add key list with urls ([83784ef](https://github.com/oktetlabs/bublik-ui/commit/83784ef337099e2176d3303ca148aedbcf39b7d7))\\n- **run:** add column visibility toggle to run/diff pages ([ab0d28e](https://github.com/oktetlabs/bublik-ui/commit/ab0d28e4fa15380310e18801e0b3151eaf0d46cc))\\n- **run:** add tooltips to details/toolbar buttons ([73c2bb5](https://github.com/oktetlabs/bublik-ui/commit/73c2bb562a4681dda4de7ac867a1db209a5e3161))\\n- **sidebar:** add collapsible links ([1295902](https://github.com/oktetlabs/bublik-ui/commit/1295902aa48f55568f47a8948b632696f472f7ee))\\n- **sidebar:** show/hide sidebar on `s` keypress ([ef529b8](https://github.com/oktetlabs/bublik-ui/commit/ef529b839c80850c5b33312d98f14aec4fc5b048))\\n- **ui:** add dropdown menu component ([cea395f](https://github.com/oktetlabs/bublik-ui/commit/cea395feb7f1b9586f394e532da2b4de2947688e))\\n- **ui:** add skeleton component ([cfd9b98](https://github.com/oktetlabs/bublik-ui/commit/cfd9b980e9cd80e72cca47ba02797776ea46e5d5))\\n\\n#### \u23ea Reverts\\n\\n- **log:** [frame] not saving line number on navigations ([f77e166](https://github.com/oktetlabs/bublik-ui/commit/f77e1662b5e8d1aa60fb40b789246d6efb96ea84))\\n- **run:** rollback renaming column ids for run table ([ad334d5](https://github.com/oktetlabs/bublik-ui/commit/ad334d5057dd6d25b0d993ad6e88ef4c738da056))\\n\\n#### \u2705 Tests\\n\\n- **ci:** fix lint command ([0bf7f43](https://github.com/oktetlabs/bublik-ui/commit/0bf7f435d4783069cc4a20e49a90766954c861ec))\\n- **e2e:** add playwright support ([0ec5dfe](https://github.com/oktetlabs/bublik-ui/commit/0ec5dfe008f89e2e29d605e169c9d37d439f3cbd))\\n- **history:** add some snapshot tests to history ([7aa7dba](https://github.com/oktetlabs/bublik-ui/commit/7aa7dbaf427626e3c7f15c76f02ddee16a9d35b6))\\n- **import:** fix snapshot for overflow table ([a9d5360](https://github.com/oktetlabs/bublik-ui/commit/a9d5360c358eeb9e2e41529a657df88a1af97d61))\\n- **import:** fix snapshot test for loading table state ([518a2e6](https://github.com/oktetlabs/bublik-ui/commit/518a2e6f4d8dd9c520bc51096cd302889d10d614))\\n- **log:** remove build target from lib ([fe240a7](https://github.com/oktetlabs/bublik-ui/commit/fe240a746b67be7ba83313eb822d6ef7276e545b))\\n- **run:** fix div instead of button when no url present ([63dfee6](https://github.com/oktetlabs/bublik-ui/commit/63dfee6702cd0f2e7a88c1c20ef433cfdad3035d))\\n- **ui:** [clock] fix timezone issue in CI ([897a578](https://github.com/oktetlabs/bublik-ui/commit/897a578338aef8b2eeef1eed1b8d3024da79d10f))\\n- **ui:** [icon] fix svgr not loading in vitest ([365b5e7](https://github.com/oktetlabs/bublik-ui/commit/365b5e7b9ad64e481f7b633b0beabe70955a5c6a))\\n\\n#### \ud83d\udce6 Chores\\n\\n- **build:** migrate from webpack to vite ([749a97b](https://github.com/oktetlabs/bublik-ui/commit/749a97bbc2a32f3084788588ba7e8cf69d23a9bf))\\n- **build:** upgrade vite to v4.3 ([177fd89](https://github.com/oktetlabs/bublik-ui/commit/177fd89558e3edf0f4e603ccb2558a55e880d0a9))\\n- **changelog:** [modal] disable modal until checkbox is ready ([ca82635](https://github.com/oktetlabs/bublik-ui/commit/ca826357194d39a25484f73c85740342535ba324))\\n- **changelog:** lazy load changelog ([03d0276](https://github.com/oktetlabs/bublik-ui/commit/03d027675f827f431103667811f75fb7df0f8223))\\n- **ci:** add new commit types ([13730fa](https://github.com/oktetlabs/bublik-ui/commit/13730fa92089d8738324269d0c341550e37efdf5))\\n- **ci:** fix compare url ([eff2eb6](https://github.com/oktetlabs/bublik-ui/commit/eff2eb61ac759f3b3bdadb80506950549f1e3b71))\\n- **ci:** update pipeline for manual releases ([425702d](https://github.com/oktetlabs/bublik-ui/commit/425702d8d94d8ad47da1a170199884bcab159b5c))\\n- **deploy:** adjust api for new JSON format ([e4713a4](https://github.com/oktetlabs/bublik-ui/commit/e4713a4b50b93c4c002f9ddc4def97961a3c5313))\\n- **env:** move all env configs to bublik app config ([e353093](https://github.com/oktetlabs/bublik-ui/commit/e353093e340777168df452685272b190460a9ad1))\\n- **log:** add run id to tab title ([8c88283](https://github.com/oktetlabs/bublik-ui/commit/8c882830a9dffa486284f70d94d341259af65a54))\\n- **log:** remove zod schema converting to JSON from production bundle ([24f2b3f](https://github.com/oktetlabs/bublik-ui/commit/24f2b3f8067ca62f8f8ead5038512329d4317a31))\\n- **nx:** upgrade nx to 16.2.1 ([6184eaf](https://github.com/oktetlabs/bublik-ui/commit/6184eaf8a86c70cb85ed65e21c3bf36d9d57296c))\\n- **release:** v0.16.0 ([8d0b1cd](https://github.com/oktetlabs/bublik-ui/commit/8d0b1cdfcd87215cee6c3b974d46c98d503a75af))\\n- **test:** update snapshots ([4839df8](https://github.com/oktetlabs/bublik-ui/commit/4839df8d49476a26fdb251d8831fbae3b6f7c08d))\\n\\n### Backend\\n\\n#### \ud83d\udc85 Polish\\n\\n- update run stats structure\\n- reduce the number of requests when fetching the result details\\n- reduce the number of queries to the DB for retrieving metas and test arguments\\n- recalculate stats for the previously imported runs\\n- avoid measurement results dups after live import\\n\\n#### \ud83d\ude80 New Feature\\n\\n- implement the new API to get JSON log URL\\n- add runtime to the import table"},{"id":"release-v0.1.3","metadata":{"permalink":"/bublik-release/release-v0.1.3","editUrl":"https://github.com/oktetlabs/bublik-release/edit/main/blog/2023-03-17-release-v0.1.3/index.mdx","source":"@site/blog/2023-03-17-release-v0.1.3/index.mdx","title":"Release v0.1.3","description":"We are happy to announce Bublik v0.1.3","date":"2023-03-17T00:00:00.000Z","formattedDate":"March 17, 2023","tags":[{"label":"release","permalink":"/bublik-release/tags/release"}],"readingTime":1.26,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/ol-limonikas","imageURL":"https://github.com/ol-limonikas.png","key":"ol-limonikas"}],"frontMatter":{"title":"Release v0.1.3","authors":["ol-limonikas"],"tags":["release"],"slug":"release-v0.1.3"},"prevItem":{"title":"Release v0.1.5","permalink":"/bublik-release/release-v0.1.5"},"nextItem":{"title":"Release v0.1.2","permalink":"/bublik-release/release-v0.1.2"}},"content":"We are happy to announce **Bublik v0.1.3**\\n\\nAdded features, bugs and more!\\n\\n\x3c!--truncate--\x3e\\n\\n# Highlights\\n\\n### New icon for skipped tests\\n\\n![Log page tree skipped tests](./img/SCR-20230318-chrl.png)\\n\\n### Added more data to import event table\\n\\n![Import page table](./img/SCR-20230318-cjpi.png)\\n\\n### New form for importing multiple runs at once\\n\\n![Import multiple runs at once](./img/SCR-20230317-hkff.png)\\n\\n![Import list results](./img/SCR-20230317-hlar.png)\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\ude80 New Feature\\n\\n- feat(dashboard): expand NOK result on link click for `unexpected`\\n- feat(import): add form for importing multiple runs at once\\n- feat(import): add filter by task id, error message, log url to form\\n- feat(log): mark skipped tests with icon\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- fix(import): fix sidebar not sticking when table overflows page\\n\\n#### \ud83d\udc85 Polish\\n\\n- style(import): fix header dissapearing on when error present\\n- style(import): overflowing table should be scrollable\\n- chore(history): format dates in header legend\\n\\n---\\n\\n### Backend\\n\\n#### \ud83d\ude80 New Feature\\n\\n- change the error message structure\\n- add \'skipped\' info to the iteration data forwarded to the UI\\n- add new endpoint /v2/importruns/source to make imports from import status table\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- runs import without logs\\n\\n#### \u270f\ufe0f Other\\n\\n- add facility, severity, timestamp and Error message to the import statuses table\\n- add filtration by Celery task ID, Error message, Log URI to the import statuses table\\n- change the format of storing the expected result keys\\n- move key parsing from the import stage to the statistics generation stage\\n- add support for \\"ref://type/tail\\" keys to key parsing"},{"id":"release-v0.1.2","metadata":{"permalink":"/bublik-release/release-v0.1.2","editUrl":"https://github.com/oktetlabs/bublik-release/edit/main/blog/2023-02-20-release-v0.1.2/index.mdx","source":"@site/blog/2023-02-20-release-v0.1.2/index.mdx","title":"Release v0.1.2","description":"We are happy to announce Bublik v0.1.2","date":"2023-02-20T00:00:00.000Z","formattedDate":"February 20, 2023","tags":[{"label":"release","permalink":"/bublik-release/tags/release"}],"readingTime":1.73,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/ol-limonikas","imageURL":"https://github.com/ol-limonikas.png","key":"ol-limonikas"}],"frontMatter":{"title":"Release v0.1.2","authors":["ol-limonikas"],"tags":["release"],"slug":"release-v0.1.2"},"prevItem":{"title":"Release v0.1.3","permalink":"/bublik-release/release-v0.1.3"},"nextItem":{"title":"Release v0.1.1","permalink":"/bublik-release/release-v0.1.1"}},"content":"We are happy to announce **Bublik v0.1.2**\\n\\nIn this release we focused on more robust error experience, so you can have more context on what exactly went wrong.\\nAlso, we added more self-describing tab names, so you can easily find what you are looking for.\\n\\n\x3c!--truncate--\x3e\\n\\n# Highlights\\n\\n## Error details\\n\\n### Example error\\n\\n![Error details](./img/history-error.png)\\n\\n## History context menu\\n\\n:::info\\nSelecting tags will apply filters and refetch the data. <br/>\\nIt works just like clicking refresh button\\n\\n:::\\n\\n![History context menu](./img/history-context-menu.png)\\n\\n## Tab names\\n\\n### Example tab names\\n\\n![Tab names](./img/tabs.png)\\n\\n## Details diff\\n\\n### Example diff\\n\\n![Details diff](./img/details-diff.png)\\n\\n## Event logs\\n\\n### Example event logs table\\n\\n![Events logs table](./img/event-log.png)\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\ude80 New Feature\\n\\n- feat(history): add reset button to history global filter form\\n- feat(history): add context menu to history linear/aggregation tables\\n- feat(help): bake frontend revisions into deploy-info component at build time\\n- feat(dev): add events table with celery task status and links to logs/flower\\n- feat(run-diff): [details] add diff for run info details\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- fix(history): remove unnecessary requests if no test name is found\\n- fix(history): failing to parse URL search params on some requests\\n- fix(runs): add total percentage of expected runs\\n- fix(run-diff): don\'t show suspence loading spinner for run-diff page\\n- fix(dev): flower URL is incorrect in iframe\\n- fix(ui): [datepickers] wrong order of date segments and wrong literals\\n\\n#### \ud83d\udc85 Polish\\n\\n- style(history): add backdrop blur for dialogs\\n- style(history): place duration in column to save some space\\n- style(run): add empty state for run page\\n- chore(sidebar): move flower/import/tests links under dev menu\\n\\n---\\n\\n### Backend\\n\\n#### \ud83d\ude80 New Feature\\n\\n- the table of import statuses is added to the dev section\\n\\n#### \ud83d\udcbe DB changes\\n\\n- added a new model - EventLog to log Bublik events\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- parse and show plan info\\n\\n#### \u270f\ufe0f Other\\n\\n- persistent option added to the Flower service to save Celery tasks after services restart\\n- changes applied to gunicorn and nginx to change max buffer and size of URIs"},{"id":"release-v0.1.1","metadata":{"permalink":"/bublik-release/release-v0.1.1","editUrl":"https://github.com/oktetlabs/bublik-release/edit/main/blog/2023-01-20-release-v0.1.1/index.mdx","source":"@site/blog/2023-01-20-release-v0.1.1/index.mdx","title":"Release v0.1.1","description":"We are happy to announce Bublik v0.1.1","date":"2023-01-20T00:00:00.000Z","formattedDate":"January 20, 2023","tags":[{"label":"release","permalink":"/bublik-release/tags/release"}],"readingTime":3.515,"hasTruncateMarker":true,"authors":[{"name":"Kostromin Danil","title":"Bublik UI Maintainer","url":"https://github.com/ol-limonikas","imageURL":"https://github.com/ol-limonikas.png","key":"ol-limonikas"}],"frontMatter":{"title":"Release v0.1.1","authors":["ol-limonikas"],"tags":["release"],"slug":"release-v0.1.1"},"prevItem":{"title":"Release v0.1.2","permalink":"/bublik-release/release-v0.1.2"}},"content":"We are happy to announce **Bublik v0.1.1**\\n\\nWe\'ve added experimental support for comparing two runs, new datepicker component with better accessibility and keyboard navigation, new page mode for history where you can see values change over time and more.\\n\\n\x3c!--truncate--\x3e\\n\\n# Highlights\\n\\n## Run Diff\\n\\n:::caution\\n\\nThis feature is experimental and may not work as expected\\n\\n:::``\\n\\n### Diff view\\n\\nIn this release we\'ve added experimental support for comparing two runs\\n\\n![Run diff page](./img/run-diff-page.png)\\n\\n### Access diff from runs page\\n\\nYou can now click on two run rows on runs page and select `Compare` button to compare them\\n\\n![Runs selection](./img/runs-to-diff.png)\\n\\n### Access diff from run page\\n\\nYou can access this page via `Run` -> `Compare` button\\n\\n![Compare button](./img/compare-button.png)\\n\\n---\\n\\n## History\\n\\n### Filter Reset\\n\\nYou can now reset client side filters in history page\\n\\n:::info\\n\\nSometimes client side filters _(click search)_ may not work as expected. In this case you can reset them by clicking on `Reset filters` button\\n\\n:::\\n\\n![History reset filters](./img/history-reset-filters.png)\\n\\n### Measurements\\n\\nWe\'ve also added a new page mode for history where you can see values change over time\\n\\n![History charts](./img/history-charts.png)\\n\\n#### Measurement Info\\n\\nYou can click on chart point to bring up modal with additional information as well as ability to jump directly to log/measurements/run\\n\\n![History charts modal](./img/history-chart-modal.png)\\n\\n---\\n\\n## New Date pickers\\n\\nWe\'ve added new datepicker component with better accessibility and keyboard navigation\\n\\n### Datepicker\\n\\n![Datepicker](./img/datepicker.png)\\n\\n### Date-range picker\\n\\n![Date range picker](./img/date-range-picker.png)\\n\\n---\\n\\n## Changelog\\n\\n### Frontend\\n\\n#### \ud83d\ude80 New Feature\\n\\n- feat: add new datepicker component with better accessibility\\n- feat: add new datepicker range component with better accessibility\\n- feat(run): add URL state handling for run table\\n- feat(run): add ability to compare runs via form in run\\n- feat(run): add skeleton loading for run details state\\n- feat(run-diff): add initial run-diff page\\n- feat(measurements): add suspended ui and skeleton for history measurements\\n- feat(log): add skeleton loading to log tree\\n- feat(help): add better error message when couldn\'t fetch revisions\\n- feat(history): add reset client side filters button to history\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- fix(run): `crtl + click` not applying filters to subtree\\n- fix(run-diff): change the way arrow direction is decided for run-diff\\n- fix(run-diff): improve package matching\\n- fix(help): tooltip with revision info not working\\n- fix(measurements): gap in value table column\\n- fix: enable horizontal scroll for badge input by default\\n- fix(measurements): export crashing on empty values\\n- refactor(runs): rewrite runs page with better architecture\\n- refactor(history): rewrite history page with better architecture\\n\\n#### \ud83d\udc85 Polish\\n\\n- fix(history): don\'t reset date range field in history global search\\n- feat(history): add history skeleton on no results found\\n- chore(history): add border around table rows\\n- feat(runs): add skeleton when no results found\\n- chore(runs): add border around table rows\\n- fix: badge rendering as button when no `onClick` handler passed\\n\\n---\\n\\n### Backend\\n\\n#### \ud83d\ude80 New Feature\\n\\n- meta_categorization: change the approach of categorizing metas\\n- commands: add command to add tags extracted from the log\\n\\n#### \ud83d\udc1b Bug Fix\\n\\n- measurements: change the json forwarded to the UI\\n- measurements: increase the speed of processing by using faster sorting and filtering methods for DB objects\\n- measurements: create proper objects in DB when handling measurements\\n- charts: add axises_config and axises titles to the json forwarded to the UI\\n- charts: combine chart that differ only in comments\\n- history: increase the speed by using proper filtration of test results, test runs, results and test\\n- importruns: change an option forwarded to rgt-log-bundle-get-original from TE since it has changed in TE itself\\n- importruns: change the handling of measurements import errors\\n- hash: the default hashing algorithm was changed to avoid creating duplicates in DB\\n- metas: add check for STATUS meta in `meta_data.json`\\n- metas: update metas even if the run is not completed\\n- cache: update cache after new meta categorization process\\n- celery: add option to specify number of task after completing which the worker will be reloaded\\n- run_diff: add execution sequence to the data provided to UI to show run_diff\\n- result_summary: return only summary values not the whole results\\n\\n  #### Other changes\\n\\n- coding_style: apply **black**, **flynt**, **unify** and **isort** to the whole project"}]}')}}]);